import React from "react";
import produtos from "../../Data/produtos";

export default props => {
    function getLinhas() {
        return produtos.map(produto => {
            return (
                <tr>
                    <td>{produto.id}</td>
                    <td>{produto.nome}</td>
                    <td>R${produto.preço}</td>
                </tr>
            )
        })
    }
    return (
        <div>
            <table>
                <thead>
                    <tr>
                        <th>Id</th>
                        <th>Nome</th>
                        <th>Preço</th>
                    </tr>
                </thead>
                <tbody>
                    {getLinhas}
                </tbody>
            </table>
        </div>
    )
};
